@qiheihelan Hi！
I am not sure if you are just starting to study image registration and deep learning soon. If I were you, I would try to run train.py and test.py using the data provided by the author. And I'm going to try to combine the paper and the code to figure out how voxelmorph works.
Then start preprocessing your own data. In addition to what the author said (making sure the data is the same size and a multiple of 16, normalizing to [0-1]), you also need to ensure that your data is isotropic. When your data is preprocessed, you can train your own model.
